- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CThe transfer from the ASDC program
    has an accompanying memo item disclosing contributions received.  An additional
    transfer, previously disclosed as from the ASDC, was actually from the DNC as
    part of another joint fundraiser.  That transfer has been amended.  The credit
    card payment to Advanta represented payment of an outstanding balance.  Detailed
    disbursements were disclosed during previous periods.  A disbursement to NCEC
    for voter file work was not FEA and has been so amended.  Expenditures for podium
    rental and teleprompter rental were for the democratic state convention, not made
    on behalf of a specifially identified federal candidate or for fundraising activity.
    \ Disbursements originally coded for mileage and housing stipends were actually
    for housing stipends alone and have been so amended."
